import React from "react";
import { Card, Followers, Username, UsernameContainer } from "./styles";

const BorderCard = ({
  src = "/images/icon-facebook.svg",
  username = "diego9497",
  followers = 3222,
  followersChange,
  change,
}) => {
  return (
    <Card>
      <UsernameContainer>
        <img src={src} alt="" />
        <Username>{username}</Username>
      </UsernameContainer>
      <FollowersContainer>
        <Followers>{followers}</Followers>
        <span>Followers</span>
      </FollowersContainer>
      <p>Today</p>
    </Card>
  );
};
export default BorderCard;
